import React from 'react';
import '../CSS/Footer.css';

const Footer = () => {
    return (
        <div className="footer">
            <div className="footer-left"></div>
            <div className="footer-middle"></div>
            <div className="footer-right"></div>
        </div>
    );
};

export default Footer;
